import React, { useEffect, useState,useContext } from 'react'
import Definition from '../Definition/Definition'
import DescriptionData from './DescriptionData'
import {
    useSearchParams
  } from "react-router-dom";
import axios from 'axios'
import './ProjectDescription.scss'
import UserContext from '../UserContext';
import WeeklyUpdate from '../WeeklyForm/WeeklyUpdate';

const ProjectDescription = () => {

    const[shownOff,setShownOff]=useState(false);
    const[month,setMonth]=useState(0);
    const[week,setWeek]=useState(0);
    const[weeklyReport,setWeeklyReport]=useState([]);
    const [searchParams] = useSearchParams();

    const idvalue=searchParams.get('id');
    const details=idvalue.slice(1,33)



// const Description=[{
//         TMfixedCost: "3938493",
//         resourcesUsed:10,
//         weeklyCompletion: 45,
//         numberOfStories: 45,
//         featuresCompleted: 34,
//         newBugs: 45,
//         bugsFixed: 34,
//         codeReview: true,
//         unitTesting: true,
//         weeklyCommunication: false,
//         delay : 10,
// }]

 const others= [{

            dependencies: " Dependencies in project management deal with managing and scheduling project tasks while keeping their sequences and requirements in mind. If task B requires the completion of task A,",
            riskMitigation: " No RiskMitigation",
            risks: "No Risks in the Week",
            supportRequired: <ul><li> Uptime requirements for a service.</li>
                                 <li>Data storage capacity per customer.</li>
                                 <li> Back-up processes for managing risks.</li></ul>
        }]

        const months=(id)=>{};
        const weekupdate=(id)=>{};

  useEffect(()=>{
        axios.post("http://13.233.18.99:3010/api/v1/reports/getWeeklyReport",
        {

          "ProjectId":"c5c100b648cd40c0a27d1e61a6811952",
          "Month":11,
          "Week":2


        })
        .then((response) => {

          setWeeklyReport(response?.data);
          console.log("report1",response.data)


          console.log("weekpost",response)


        })

        .catch(error => {
          console.log("error",error);
        })

    },[])



    console.log("report",weeklyReport)


    return (

        <div>

        <div className='ForUpdate'>
       <div className='ForUpdate_Year'>

        <div className="ForUpdate_Year_Month">
        <select   className='ForUpdate_Year_Month_All'>
                <option  onChange={()=>months("january")}>January</option>
                <option onChange={()=>months("february")}>February</option>
                <option>March</option>
                <option>April</option>
                <option>May</option>
                <option>June</option>
                <option>July</option>
                <option>August</option>
                <option>September</option>
                <option>October</option>
                <option>November</option>
                <option>December</option>

            </select>
       </div>



         <div className='ForUpdate_Year_Week_btn'>
             <button className='ForUpdate_Year_Week_btn_1'  onClick={()=>weekupdate("1")}>Week 1</button>
             <button className='ForUpdate_Year_Week_btn_2'  onClick={()=>weekupdate("2")}>Week 2</button>
             <button className='ForUpdate_Year_Week_btn_3'  onClick={()=>weekupdate("3")}>Week 3</button>
             <button className='ForUpdate_Year_Week_btn_4'  onClick={()=>weekupdate("4")}>Week 4</button>
         </div>


      </div>
        <div className='ForUpdate_btn'>
        <button className='ForUpdate_btn_1' onClick={()=>setShownOff(true)}>Update</button> 
        </div>  



    </div>
    <WeeklyUpdate trigger={shownOff} setShownOff={setShownOff}/>

        <div className='ProjectDescription-All'>

            <div className='ProjectDescription_Data' >



                  {console.log("divum",weeklyReport)}
                  {console.log("divum2",weeklyReport.content?.Weekly_reports)}
                   {Object.keys(weeklyReport) && Object.keys(weeklyReport).map((data)=>(                                        
                    <DescriptionData data={data}/>))}



            </div>
             <div>

                    {others&& others.map((value) =>

                        <Definition value={value} />)}

            </div> 
        </div>
        </div>


    )


}
export default ProjectDescription;
